public static intNode delete(intNode start, int target)
	{
		intNode pointer = start;
		intNode prev = null;
		while(pointer!=null && pointer.data !=target)
		{
			prev = pointer;
			pointer = pointer.next;

		}
		if (pointer == null)
			return null;
		else if (pointer==start)
		{
			return pointer.next;

		}
		else
		{
			prev.next = pointer.next;
			return start;
		}



	}

